import FooterActionTypes from "../footer-types.js"

const toggleFooter = () => ({
    type: FooterActionTypes.TOGGLE_FOOTER_HIDDEN,
    type: FooterActionTypes.DISPLAY_FOOTER
})

export default toggleFooter;
